from django.db import modelsfrom apps.account.models import Accountfrom apps.logus.models import TariffModel, RoomTypeModelclass BookedRoomModel(models.Model):    tariff = models.ForeignKey(TariffModel, on_delete=models.CASCADE)    room_type = models.ForeignKey(RoomTypeModel, on_delete=models.CASCADE)    guests_number = models.IntegerField()    created_by = models.ForeignKey(Account, related_name="booked_room", on_delete=models.SET_NULL, null=True)    created_at = models.DateTimeField(auto_now_add=True)    modified_at = models.DateTimeField(auto_now=True)    modified_by = models.ForeignKey(Account, related_name="modf_booked_room", on_delete=models.SET_NULL, null=True)    def __str__(self):        return f"{self.tariff} - {self.room_type} - {self.guests_number}"